int encode(char *str,int *s)
{
	for(int i=0;i<N;i++)
		s[i]=0;
	int len=strlen(str);
	s[0]=len;
	int pwc[4];
	for(int i=pwc[0]=1;i<4;i++)
		pwc[i]=pwc[i-1]*Ctot;
	for(int i=0;i<len;i++)
		s[i/4+1]+=pwc[i%4]*I[str[i]];
	return (len-1)/4+1;
}

int decode(int *s,char *str)
{
	int len=min(s[0],N);
	int pwc[4];
	for(int i=pwc[0]=1;i<4;i++)
		pwc[i]=pwc[i-1]*Ctot;
	for(int i=0;i<len;i++)
		str[i]=C[s[i/4+1]/pwc[i%4]%Ctot];
	str[len]=0;
	return len;
}

